import React from 'react';
import Dashboard from './Dashboard';
import NewPost from './NewPost';
import UpdatePost from './UpdatePost';
import RemovePost from './RemovePost';

const MenuList = {
    list: [
        <Dashboard />,
        <NewPost />,
        <UpdatePost />,
        <RemovePost />
    ]
}
export default MenuList;
